}

const elmStyle = {
    backgroundColor: "red",
    fontSize: "20px",
    boxShadow: "0px 20px 10px black"
}

    return(
        <div>
        <h1 style={{
    backgroundColor: "red",
    fontSize: "20px",
    boxShadow: "0px 20px 10px black"
        }}>
            hello messi</h1>
        <h2 style={elmStyle}>hello ronaldo</h2>
        <h3 className={"active redBg"}>{person.email}hi</h3>
        <button onClick={sayHello}>dada</button>
        </div>

    );
}

function sayHello(){
    alert('hello');
}
